import React from "react";
import { Box, Heading, Grommet, Image, Paragraph } from "grommet";
import SkillBar from "react-skillbars";
import AppBar from "./AppBar.js";
import Footer from "./Footer.js";

const theme = {
  global: {
    colors: {
      brand: "#116466",
    },
    font: {
      family: "Roboto",
      size: "18px",
      height: "20px",
    },
  },
};

const skills = [
  { type: "Java", level: 80 },
  { type: "JavaScript", level: 70 },
  { type: "TypeScript", level: 60 },
];

const colours = {
  bar: {
    hue: 125,
    saturation: 50,
    level: {
      minimum: 50,
      maximum: 100,
    },
  },
  title: {
    text: "#fff",
    background: "#116466",
  },
};

function Skills() {
  return (
    <Grommet theme={theme} full>
      <Box fill>
        <AppBar />
        <Box align="center">
          <Heading textAlign="center" level="2">
            Tech Stack
          </Heading>
          <Heading level="3">Languages</Heading>
        </Box>
        <Box justify="start" pad="medium">
          <SkillBar skills={skills} colors={colours} />
        </Box>
        <Heading level="3">Framework</Heading>
        <Footer />
      </Box>
    </Grommet>
  );
}

export default Skills;
